export const NavBar: React.FC<NavBarProps> = ({}) => {
  const { colorMode, toggleColorMode } = useColorMode();
  const [logout, { loading: logoutFetching }] = useLogoutMutation();
  const { data, loading } = useMeQuery({
    skip: isServer(),
  });
  const { isOpen, onOpen, onClose } = useDisclosure();

  let userBody = null;

  // data is loading
  if (loading) {
    // user not logged in
  } else if (!data?.me) {
    userBody = (
      <Flex overflowX="hidden" alignItems={"center"}>
        <NextLink href="/login">
          <Button
            variant={"ghost"}
            colorScheme={"grey"}
            size={"sm"}
            mr={4}
            leftIcon={<LockIcon />}
            _hover={{
              bg: "yellow.200",
              colorScheme: "white",
            }}
          >
            Sign in
          </Button>
        </NextLink>

        <NextLink href="/register">
          <Button
            fontWeight={600}
            _hover={{
              bg: "yellow.200",
            }}
            variant={"solid"}
            colorScheme={"yellow"}
            size={"sm"}
            mr={4}
            leftIcon={<AddIcon />}
          >
            Sign up
          </Button>
        </NextLink>
      </Flex>
    );
    // user is logged in
  } else {
    userBody = (
      <Flex alignItems={"center"}>
        <NextLink href={"/members/shop"}>
          <Button
            variant={"solid"}
            colorScheme={"yellow"}
            size={"sm"}
            mr={4}
            leftIcon={<IoBagHandleOutline size={"1.25em"} />}
          >
            Team Shop
          </Button>
        </NextLink>

        <Menu>
          <MenuButton
            as={Button}
            rounded={"full"}
            variant={"link"}
            cursor={"pointer"}
          >
            <Avatar
              name={data.me.firstname + " " + data.me.lastname}
              size={"sm"}
              src={"placeholder"}
            />
          </MenuButton>
          <MenuList>
            <Flex pl={"3.5"} justifyContent={"flex-start"}>
              Hey, {data.me.firstname}!
            </Flex>
            <MenuDivider />

            <MenuItem justifyContent={"space-between"}>
              <NextLink href={"/orders"}>Order History</NextLink>
              <IoArchiveOutline size={"1.25em"} />
            </MenuItem>
            <UserSettingsModal />
            <MenuItem
              justifyContent={"space-between"}
              onClick={toggleColorMode}
              size={"sm"}
            >
              <p>Toggle Color Mode</p>
              {colorMode === "light" ? (
                <IoMoonOutline size={"1.25em"} />
              ) : (
                <IoSunnyOutline size={"1.25em"} />
              )}
            </MenuItem>
            <MenuDivider />
            <MenuItem
              onClick={() => {
                logout();
                router.push("/");
              }}
              isLoading={logoutFetching}
              variant="link"
              justifyContent={"space-between"}
            >
              Logout
              <IoLogOutOutline size={"1.25em"} />
            </MenuItem>
          </MenuList>
        </Menu>
      </Flex>
    );
  }

  return (
    <Box
      bg={useColorModeValue("gray.100", "gray.900")}
      px={8}
      zIndex={2}
      position="sticky"
      top={0}
      boxShadow={"lg"}
    >
      <Flex h={16} alignItems={"center"} justifyContent={"space-between"}>
        <IconButton
          size={"md"}
          icon={isOpen ? <CloseIcon /> : <HamburgerIcon />}
          aria-label={"Open Menu"}
          display={{ md: "none" }}
          onClick={isOpen ? onClose : onOpen}
        />

        <HStack spacing={8} alignItems={"center"}>
          <Box>
            <Logo />
          </Box>

          <HStack as={"nav"} spacing={4} display={{ base: "none", md: "flex" }}>
            {Links.map((link) => (
              <NavLink key={link}>{link}</NavLink>
            ))}
          </HStack>
        </HStack>

        <Flex display={{ base: "none", md: "flex" }}>{userBody}</Flex>
      </Flex>

      {isOpen ? (
        <Box pb={4} display={{ md: "none" }}>
          <Stack as={"nav"} spacing={4}>
            {Links.map((link) => (
              <NavLink key={link}>{link}</NavLink>
            ))}
            <Flex justifyContent={"flex-end"}>{userBody}</Flex>
          </Stack>
        </Box>
      ) : null}
    </Box>
  );
};
